import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';
import { VerticalTimeline, VerticalTimelineElement } from 'react-vertical-timeline-component';
import 'react-vertical-timeline-component/style.min.css';

export const Education = () => {
    return (
        <div id="Education">


            <Container>
                <div className='mt-4 d-flex justify-content-center' ><h1>EDUCATION</h1></div>
                <div className='my-4'>

                    <VerticalTimeline lineColor={"black"}>
                        <VerticalTimelineElement
                            className="vertical-timeline-element--work"
                            date="Jan 2024 - March 2024"
                            contentStyle={{ background: ' #781ACF', color: '#fff' }}
                            contentArrowStyle={{ borderRight: "7px solid #781ACF" }}
                            iconStyle={{ background: " #781ACF", color: "#fff" }}
                        //    icon={<WorkIcon />}
                        >
                            <h3 className="vertical-timeline-element-title text-dark">PENETRATION TESTER INTERN</h3>
                            <h4 className="vertical-timeline-element-subtitle text-dark">
                                HackersForYou
                            </h4>
                            <p className='text-white-1000 fs-3'>• Web App Penetration testing <br />
                                • Report creating</p>
                        </VerticalTimelineElement>
                        <VerticalTimelineElement
                            className="vertical-timeline-element--work"
                            date="Jan 2024 - March 2024"
                            contentStyle={{ background: ' #781ACF', color: '#fff' }}
                            contentArrowStyle={{ borderRight: "7px solid #781ACF" }}
                            iconStyle={{ background: " #781ACF", color: "#fff" }}
                        //    icon={<WorkIcon />}
                        >
                            <h3 className="vertical-timeline-element-title text-dark">PENETRATION TESTER INTERN</h3>
                            <h4 className="vertical-timeline-element-subtitle text-dark">
                                HackersForYou
                            </h4>
                            <p className='text-white-1000 fs-3'>• Web App Penetration testing <br />
                                • Report creating</p>
                        </VerticalTimelineElement>




                        <VerticalTimelineElement
                            iconStyle={{ background: "rgb(33, 150, 243)", color: "#fff" }}
                        //    icon={<StarIcon />}
                        />
                    </VerticalTimeline>
                </div>
            </Container>
        </div>
    )
}
